angular.module("sortApp",["angularUtils.directives.dirPagination"]).controller("mainController",function(t,r){r.get("tracks.json").then(function(r){t.tracks=r.data,t.addedTracks=[]}),t.removeSong=function(r){t.tracks.splice(t.tracks.indexOf(r),1)},t.addSong=function(r){t.tracks.splice(t.tracks.indexOf(r),1),t.tracks.push(t.addedTracks)},t.sortType="Artist",t.sortReverse=!1});